$root_dir = $_SERVER['DOCUMENT_ROOT'].'/'.explode("/", $_SERVER['SCRIPT_NAME'])[1];
//=================(START) FOR LOADING THE ENV DATA ==================//
require_once($root_dir.'/vendor/autoload.php');
$dotenv = Dotenv\Dotenv::createImmutable($root_dir);
$dotenv->load();
//=================(END) FOR LOADING THE ENV DATA ==================//
$apiKey = $_ENV['GOOGLE_TEXT_TO_VOICE_APIKEY'];
header('Content-Type: application/json');
// Getting the text and language from the POST request
$text = $_POST['text'] ?? '';
$languageCode = $_POST['language'] ?? 'en-US';
$languageGender = $_POST['languageGender'] ?? 'NEUTRAL';
$validLanguageGender = ['FEMALE', 'MALE', 'NEUTRAL'];
//LANGUAGE VALIDATION 
if(!in_array($languageGender, $validLanguageGender)){
    $validLanguageGenderText = implode(", ", $validLanguageGender);
    echo json_encode(['error' => "INVALID VALUE IN KEY -languageGender, It must be from among these - $validLanguageGenderText"]);
    exit;
}

// Validate input
if (empty($text) || strlen($text) < 2) {
    echo json_encode(['error' => 'Text is required. and text lenght must be at least 2 character.']);
    exit;
}

// Prepare the request payload
$requestData = [
    'input' => [
        'text' => $text
    ],
    'voice' => [
        'languageCode' => $languageCode,
        'ssmlGender' => $languageGender
    ],
    'audioConfig' => [
        'audioEncoding' => 'MP3'
    ]
];

// Initialize cURL
$ch = curl_init();
curl_setopt($ch, CURLOPT_URL, "https://texttospeech.googleapis.com/v1/text:synthesize?key=$apiKey");
curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
curl_setopt($ch, CURLOPT_POST, true);
curl_setopt($ch, CURLOPT_HTTPHEADER, ['Content-Type: application/json']);
curl_setopt($ch, CURLOPT_POSTFIELDS, json_encode($requestData));

// Execute cURL request
$response = curl_exec($ch);
curl_close($ch);

// Check if the request was successful
if ($response === false) {
    echo json_encode(['error' => 'Request failed.', 'success' => false]);
    exit;
}

// Decode the JSON response
$responseData = json_decode($response, true);

// Check if audio content is present
if (isset($responseData['audioContent'])) {
    echo json_encode(['audioContent' => $responseData['audioContent'], 'success' => true]);
} else {
    echo json_encode(['error' => 'Failed to synthesize speech.', 'success' => false]);
}

?>
